import React, {useEffect, useState} from "react";

const Navbar = () => {
    return (
        <nav>
            <h2>LOGO</h2>
            <ul>
                <li>About</li>
                <li>Services</li>
                <li>Contact</li>
            </ul>
        </nav>
    );
}

export default Navbar;
